import React from "react";
import { Row, Col, Card, Button, Container } from "react-bootstrap";
import Hero from "../components/Hero";
import Speech from "../components/Speech";
import "./Home.css";

const Home = () => {
  return (
    <div>
      <Hero />
      <Speech style={{zIndex:"999"}}/>
      <Container fluid style={{backgroundColor: "black", justifyContent: "center"}}>
      <Row gutter={[24,24]} style={{ justifyContent: "center", padding: "50px" }}>
      <Card style={{ width: "30rem" }}>
          <Card.Body>
            <Card.Title style={{ fontSize: "1.5rem", fontWeight: "400", textAlign: "center" }}>Check out my other projects</Card.Title>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
        </Row>
      <Row gutter={[24,24]} style={{ justifyContent: "center", padding: "50px" }}>
        <Card style={{ width: "30rem" }}>
          <Card.Body>
            <Card.Title>Check out</Card.Title>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
        <Card style={{ width: "30rem" }}>
          <Card.Body>
            <Card.Title>Check out</Card.Title>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
      </Row>
      </Container>
    </div>
  );
};

export default Home;
